local allowedTypes = {
  ['Trailer'] = true,
  ['Automobile'] = true,
  ['Quad'] = true,
  ['Monster Truck'] = true,
  ['BMX'] = true,
  ['Bike'] = true
}

local waterProtection = true
local intervalTick = getTickCount()

function getNodeID(x, y)
  return math.floor((x + 3000) / 750) + math.floor((y + 3000) / 750) * 8
end

function findNearestRoad(zone, x, y)
  local nodeStart = -1
  local distance = 10000
  for i,queue in pairs(zone) do
      local nodeDistance=getDistanceBetweenPoints2D(x,y,queue.x,queue.y)
      if distance > nodeDistance then
          distance = nodeDistance
          nodeStart = queue
      end
  end
  return nodeStart
end

addEvent('onClientWaterProtectionChange', true)
addEventHandler('onClientWaterProtectionChange', localPlayer, function(newState)
		waterProtection = newState
	end
)

addEventHandler('onClientPreRender', root, function()
    if getTickCount() - intervalTick > 1000 and waterProtection then
      intervalTick = getTickCount()

      local theVehicle = getPedOccupiedVehicle(localPlayer)
      if not theVehicle then
        return
      end

      if not (isElementInWater(theVehicle)) then
        return
      end

      local theVehicleSeat = getPedOccupiedVehicleSeat(localPlayer)
      if theVehicleSeat ~= 0 then
        return
      end

      local theVehicleType = getVehicleType(theVehicle)
      if not (allowedTypes[theVehicleType]) then
        return
      end

      local vehicleX, vehicleY = getElementPosition(theVehicle)

      local nodeID = getNodeID(vehicleX, vehicleY)
      local nearestRoad = findNearestRoad(roadNodes[nodeID], vehicleX, vehicleY)

      setElementPosition(theVehicle, nearestRoad.x, nearestRoad.y, nearestRoad.z, false)
    end
  end
)